import React from 'react';
import {Menu, Row} from 'antd';
import {LoginOutlined, UnorderedListOutlined, CloudOutlined, DollarCircleOutlined} from '@ant-design/icons';

const Navbar = () => {

    return (
        <Menu mode="horizontal" justify="end">
            <Row>
                
            </Row>
            <Menu.Item key="login" icon={<LoginOutlined />}>
                Login
            </Menu.Item>
            <Menu.Item key="main" icon={<UnorderedListOutlined />}>
                Main
            </Menu.Item>
            <Menu.Item key="weather" icon={<CloudOutlined />}>
                Weather
            </Menu.Item>
            <Menu.Item key="currency" icon={<DollarCircleOutlined />}>
                Currency
            </Menu.Item>
        </Menu>
    );
};

export default Navbar;
